import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import { Line } from 'react-chartjs-2';

const StockDetails = () => {
  const [originalData, setOriginalData] = useState([]);
  const [details, setDetails] = useState({});
  const [latestQuote, setLatestQuote] = useState({});
  const [error, setError] = useState('');
  const { symbol } = useParams();

  useEffect(() => {
    const fetchDetails = async () => {
      try {
        // Fetch the historical data for the stock
        const response = await axios.get(`/api/stock/${symbol}`);
        const weeklyTimeSeries = response.data['Weekly Time Series'];
        const chartData = Object.entries(weeklyTimeSeries).map(([date, data]) => ({
          date,
          open: parseFloat(data['1. open']),
          high: parseFloat(data['2. high']),
          low: parseFloat(data['3. low']),
          close: parseFloat(data['4. close']),
          volume: parseFloat(data['5. volume']),
        }));
        setOriginalData(chartData);
        setDetails(chartData[0]); // Assume the latest entry is the first one

        // Fetch the latest quote for the stock
        const quoteResponse = await axios.get(`/api/quote/${symbol}`);
        const quoteData = quoteResponse.data['Global Quote'];
        setLatestQuote({
          open: parseFloat(quoteData['02. open']),
          high: parseFloat(quoteData['03. high']),
          low: parseFloat(quoteData['04. low']),
          price: parseFloat(quoteData['05. price']),
          volume: parseFloat(quoteData['06. volume']),
          latestTradingDay: quoteData['07. latest trading day'],
          previousClose: parseFloat(quoteData['08. previous close']),
          change: parseFloat(quoteData['09. change']),
          changePercent: quoteData['10. change percent'],
        });
      } catch (error) {
        console.error('Error fetching details:', error);
        setError('Error fetching data. Please try again later.');
      }
    };

    fetchDetails();
  }, [symbol]);

  const chartOptions = {
    scales: {
      x: {
        type: 'time',
        time: {
          unit: 'week',
        },
      },
    },
  };

  const chartData = {
    labels: originalData.map(data => data.date),
    datasets: [
      {
        label: 'Open',
        data: originalData.map(data => data.open),
        fill: false,
        backgroundColor: 'rgba(255, 99, 132, 0.2)',
        borderColor: 'rgba(255, 99, 132, 1)',
      },
      {
        label: 'Close',
        data: originalData.map(data => data.close),
        fill: false,
        backgroundColor: 'rgba(54, 162, 235, 0.2)',
        borderColor: 'rgba(54, 162, 235, 1)',
      },
    ],
  };

  if (error) return <div>Error fetching data: {error}</div>;
  if (!originalData.length) return <div>Loading...</div>;

  return (
    <div>
      <h1>{symbol}</h1>
      <h2>Trading Details</h2>
      <p><strong>Date:</strong> {details.date}</p>
      <p><strong>Open:</strong> ${details.open}</p>
      <p><strong>High:</strong> ${details.high}</p>
      <p><strong>Low:</strong> ${details.low}</p>
      <p><strong>Close:</strong> ${details.close}</p>
      <p><strong>Volume:</strong> {details.volume}</p>

      <h2>Latest Quote</h2>
      <p><strong>Open:</strong> ${latestQuote.open}</p>
      <p><strong>High:</strong> ${latestQuote.high}</p>
      <p><strong>Low:</strong> ${latestQuote.low}</p>
      <p><strong>Price:</strong> ${latestQuote.price}</p>
      <p><strong>Volume:</strong> {latestQuote.volume}</p>
      <p><strong>Latest Trading Day:</strong> {latestQuote.latestTradingDay}</p>
      <p><strong>Previous Close:</strong> ${latestQuote.previousClose}</p>
      <p><strong>Change:</strong> ${latestQuote.change} ({latestQuote.changePercent})</p>

      <div>
        <h2>Historical Stock Performance</h2>
        <Line data={chartData} options={chartOptions} />
      </div>
    </div>
  );
};

export default StockDetails;
